function MenuBar() {return(<Navbar>
    <h3>Home</h3>
    <input type="text" placeholder="Search.."/>
</Navbar>)}
export default MenuBar;
const Navbar = styled.div`
    >*{
        display: inline;
    }
    input{
       width: 10%;
        padding-top: 0.5%;
        padding-bottom: 0.5%;
        border-radius: 5px;
    }
    h3{
        padding-left: 30%;
        padding-right: 2%;
    }

`;
